methods.description:
Notify that an array has changed.

Example:

    this.items = [ {name: 'Jim'}, {name: 'Todd'}, {name: 'Bill'} ];
    ...
    this.items.splice(1, 1, {name: 'Sam'});
    this.items.push({name: 'Bob'});
    this.notifySplices('items', [
      { index: 1, removed: [{name: 'Todd'}], addedCount: 1,
        object: this.items, type: 'splice' },
      { index: 3, removed: [], addedCount: 1,
        object: this.items, type: 'splice'}
    ]);

Notify that a path has changed.

Example:

    this.item.user.name = 'Bob';
    this.notifyPath('item.user.name');

staticMethods.description:
Scans a template to produce template metadata.

Template-specific metadata are stored in the object returned, and node-
specific metadata are stored in objects in its flattened `nodeInfoList`
array.  Only nodes in the template that were parsed as nodes of
interest contain an object in `nodeInfoList`.  Each `nodeInfo` object
contains an `index` (`childNodes` index in parent) and optionally
`parent`, which points to node info of its parent (including its index).

The template metadata object returned from this method has the following
structure (many fields optional):

```js
  {
    // Flattened list of node metadata (for nodes that generated metadata)
    nodeInfoList: [
      {
        // `id` attribute for any nodes with id's for generating `$` map
        id: {string},
        // `on-event="handler"` metadata
        events: [
          {
            name: {string},   // event name
            value: {string},  // handler method name
          }, ...
        ],
        // Notes when the template contained a `<slot>` for shady DOM
        // optimization purposes
        hasInsertionPoint: {boolean},
        // For nested `<template>`` nodes, nested template metadata
        templateInfo: {object}, // nested template metadata
        // Metadata to allow efficient retrieval of instanced node
        // corresponding to this metadata
        parentInfo: {number},   // reference to parent nodeInfo>
        parentIndex: {number},  // index in parent's `childNodes` collection
        infoIndex: {number},    // index of this `nodeInfo` in `templateInfo.nodeInfoList`
      },
      ...
    ],
    // When true, the template had the `strip-whitespace` attribute
    // or was nested in a template with that setting
    stripWhitespace: {boolean},
    // For nested templates, nested template content is moved into
    // a document fragment stored here; this is an optimization to
    // avoid the cost of nested template cloning
    content: {DocumentFragment}
  }
```

This method kicks off a recursive treewalk as follows:

```
   _parseTemplate <---------------------+
     _parseTemplateContent              |
       _parseTemplateNode  <------------|--+
         _parseTemplateNestedTemplate --+  |
         _parseTemplateChildNodes ---------+
         _parseTemplateNodeAttributes
           _parseTemplateNodeAttribute

```

These methods may be overridden to add custom metadata about templates
to either `templateInfo` or `nodeInfo`.

Note that this method may be destructive to the template, in that
e.g. event annotations may be removed after being noted in the
template metadata.

elements.description:
`isu-select`

Example:
```html
<isu-select label="" placeholder="" items="[[items]]"></isu-select>
<isu-select label="" placeholder="" multi items="[[items]]" value="1,2"></isu-select>

<script>
items = [
{"label": "", "value": 1},
{"label": "C", "value": 2},
{"label": "", "value": 3},
{"label": "", "value": 4},
{"label": "", "value": 5},
{"label": "", "value": 6},
{"label": "", "value": 13}
];
```
## Styling

The following custom properties and mixins are available for styling:

|Custom property | Description | Default|
|----------------|-------------|----------|
|`--isu-label` | Mixin applied to the select label | {}
|`--isu-select-tag` | Mixin applied to the selected tag | {}
|`--isu-select-tag-deleter` | Mixin applied to the deleter of each tag| {}
|`--isu-select-tag-cursor` | Mixin applied to the cursor of the select | {}
|`--isu-select-dropdown` | Mixin applied to the dropdown snippet of the select | {}
|`--isu-view-text` | Mixin applied to the view mode of the select when readonly=true and isView=true | {}

