this.groupBy(array, (item) => item.a || 'nogroup');

[{a: 'group1', b: 2}, {a: 'group1', b: 4}, {a: 'group2', b: 5}]  { 'group1': [{a: 'group1', b: 2}, {a: 'group1', b: 4}], 'group2': [ {a: 'group2', b: 5}] }

GET 


```javascript
1. Request 
 const req = new Request('/test?foo=1&bar=2', {method: 'GET'});
 this.query(req).then(() => console.log());

2. url
 this.query('/test').then(() => console.log());

3. urldata
 this.query({
      url: '/test',
      data: { foo:1, bar:2 },
      handleAs: 'json'
  }).then(() => console.log());
```
